import React from 'react';

class GoogleAuth extends React.Component {
    componentDidMount() {
        //gapi - var available in window scope
        window.gapi.load('client:auth2');
    }
    render() {
        return <div>Google Auth</div>
    }
}

export default GoogleAuth;
